null,\"0ahUKEwiWlpTi0p2PAxXFRmwGHQYrMesQ3IcHCMkBKAo\",null,null,null,null,null,3,null,2]],null,null,null,null,null,null,null,[\"en\"],[[\"This Starbucks Reserve is very different from a regular Starbucks, and even from other Reserve locations. It’s crowded but very well-organized, with security and a staff member guiding guests as they enter. Prices are definitely on the higher side, but the drink menu is creative and the food looks amazing. I didn’t personally enjoy the taste of my drink, but that was just personal preference—it was well made and nicely served. Expect to wait in line for at least 20 minutes, but the space itself is stunning, so there’s plenty to look at while you wait. The menu is worth checking out in advance, and the selection of merchandise is really impressive. A cool experience overall!\",null,[0,235]]]],[null,null,null,null,null,\"https://business.google.com/local/business/11160653620099750391/customers/reviews/reply?p\\u003dCkRDaTlEUVVsUlFVTnZaRU5vZEhsalJqbHZUMjVzVTFWSGJGZE9Sa296VFc1SmVrMVVSbTlWVldSSlZqSldiMVJIWXhBQhAA\",[null,null,null,\"/local/business/11160653620099750391/customers/reviews/reply?p\\u003dCkRDaTlEUVVsUlFVTnZaRU5vZEhsalJqbHZUMjVzVTFWSGJGZE9Sa296VFc1SmVrMVVSbTlWVldSSlZqSldiMVJIWXhBQhAA\"],\"https://business.google.com/local/business/11160653620099750391/customers/reviews/deletereply?p\\u003dCkRDaTlEUVVsUlFVTnZaRU5vZEhsalJqbHZUMjVzVTFWSGJGZE9Sa296VFc1SmVrMVVSbTlWVldSSlZqSldiMVJIWXhBQhAA\",[null,null,null,\"/local/business/11160653620099750391/customers/reviews/deletereply?p\\u003dCkRDaTlEUVVsUlFVTnZaRU5vZEhsalJqbHZUMjVzVTFWSGJGZE9Sa296VFc1SmVrMVVSbTlWVldSSlZqSldiMVJIWXhBQhAA\"],null,\"https://business.google.com/local/business/11160653620099750391/customers/reviews/reply?p\\u003dCkRDaTlEUVVsUlFVTnZaRU5vZEhsalJqbHZUMjVzVTFWSGJGZE9Sa296VFc1SmVrMVVSbTlWVldSSlZqSldiMVJIWXhBQhAA\",[null,null,null,\"/local/business/11160653620099750391/customers/reviews/reply?p\\u003dCkRDaTlEUVVsUlFVTnZaRU5vZEhsalJqbHZUMjVzVTFWSGJGZE9Sa296VFc1SmVrMV
